function getVotes(e){return fetch("https://us-informant-senate.herokuapp.com"+e).then(e=>e.json())}function makeVoteArticles(e){return e.articles.length>=1?e.articles.map(e=>`<div class="card">\n           <div class="card-body">\n             <h5 class="card-title">${e.title}</h5>\n             <p class="card-text">${e.description}</p>\n             <a href="${e.url}" class="btn btn-raised btn-success" target="_blank">${e.source}</a>\n           </div>\n        </div>`):'<div class="card">\n      <div class="card-body">\n        <h5 class="card-title">No News Found</h5>\n      </div>\n    </div>'}function makeVoteCard(e,a){let t=e.map(e=>{makeVoteArticles(e);return console.log(e.articles),`\n        <div class="card vote">\n          <div class="card-header">\n          <h3><em>On ${e.created_at} The U.S. Senate Voted On:</em></h3>\n            <h3>Vote Number ${e.number}</h3>\n          </div>\n\n          <div class="card-body">\n            <h2 class="display-4">\n              <small>${e.question}</small>\n            </h2>\n            <h2 class="card-text">\n              ${e.description}\n            </h2>\n            <h2 class="card-text">\n              Result: <mark>${e.result}</mark>\n            </h2>\n          </div>\n\n          <div class="card-footer">\n          <button class="btn btn-raised btn-info" type="button" data-toggle="collapse" data-target="#collapseExample" aria-expanded="false" aria-controls="collapseExample">\n            related news\n          </button>\n          <a href="/dashboard" class="btn">Go to the dashboard to see more</a>\n          <div class="collapse vote-article-cards" id="collapseExample">\n            ${makeVoteArticles(e)}\n          </div>\n        </div>\n      `});$(a).html(t)}getVotes("/api/v1/most-recent-vote").then(e=>makeVoteCard(e,".recent-vote"));